<script>
import { reactive, ref, getCurrentInstance } from 'vue'
import Pdf from '../components/Pdf.vue'
import CropperImg from '../components/CropperImg.vue'
const imgs = ref([
  {
    id: 1001,
    titleNumber: 1,
    url: 'data:image/jpeg;base64,'
  },
  {
    id: 1011,
    titleNumber: 3,
    url: 'data:image/jpeg;base64,'
  },
  {
    id: 1201,
    titleNumber: 4,
    url: 'data:image/jpeg;base64,'
  },
  {
    id: 1021,
    titleNumber: 5,
    url: 'data:image/jpeg;base64,'
  }
])

const form = reactive({
  input: "",
  grade: "1",
  subject: "1",
  year: "",
  kind: "1",
  ab: "1"
})

const copperImg = ref(null)
const copperItem = ref(-10)

const dialogFormVisible = ref(false)

// 工具函数：
function blobToDataURL(blob) {
    let a = new FileReader();
    a.onload = function (e) { {
      var obj = imgs.value.find(item => item.titleNumber === copperItem.value)
      obj.url = e.target.result
    } }
    a.readAsDataURL(blob);

    // copperImg.value = null
    // copperItem.value = -100
    // console.log(imgs.value[0].url, imgs.value[1].url);
}

const getCopperImg = (imgVal) => {
  blobToDataURL(imgVal, copperItem)
  // console.log('得到的值', imgVal);
}

export default {
  name: 'PdfTopic',
  components: { Pdf, CropperImg },
  setup() {
    return {
      imgs,
      form,
      dialogFormVisible,
      // changeMessage
      copperImg,
      copperItem,
      getCopperImg
    }
  },
}
</script>

